import React from "react";
import styled from "styled-components";

const SidePresenter = styled.div`
  float: left;
  width: 55px;
  height: 100vh;
  background-color: #1d41f0;
  border-top: 1.4px solid #1e7efa;
  border-right: 1.4px solid #1e7efa;
`;

export default SidePresenter;
